import { Accordion } from "@material-ui/core";
import React from "react";
import Acordion from './Accordion'

const App = () => {
    return  (
        <>
            <div className="main-div">
                <div className="center-div">
                    <Acordion/>
                </div>
            </div>
        </>
    )
};

export default App;
